  display: grid;
  grid-template-rows: 25% 1fr;
  width: 100vw;
  height: 100vh;
`

const LogoSide = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #292929;
  width: 100%;
`

const LoginSide = styled.div`
  place-self: start;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  flex-flow: column;
`



const Home = ({ data }) => (
  <Container>
    <LogoSide>
      <img src="../static/mammoth-logo.png" />
    </LogoSide>
    <LoginSide>

    </LoginSide>
  </Container>
)

export default Home
